    result += cvor[25]*y[25]*imw[25]; /*C3H6 */
    result += cvor[26]*y[26]*imw[26]; /*nC3H7 */
    result += cvor[27]*y[27]*imw[27]; /*C2H3CHO */
    result += cvor[28]*y[28]*imw[28]; /*C4H7 */
    result += cvor[29]*y[29]*imw[29]; /*C4H81 */
    result += cvor[30]*y[30]*imw[30]; /*pC4H9 */
    result += cvor[31]*y[31]*imw[31]; /*C5H9 */
