    result += cvor[36]*y[36]*imw[36]; /*C7H14 */
    result += cvor[37]*y[37]*imw[37]; /*PXC7H15 */
    result += cvor[38]*y[38]*imw[38]; /*C8H16 */
    result += cvor[39]*y[39]*imw[39]; /*PXC8H17 */
    result += cvor[40]*y[40]*imw[40]; /*C9H18 */
    result += cvor[41]*y[41]*imw[41]; /*PXC9H19 */
    result += cvor[42]*y[42]*imw[42]; /*C10H20 */
    result += cvor[43]*y[43]*imw[43]; /*PXC10H21 */
    result += cvor[44]*y[44]*imw[44]; /*PXC12H25 */
    result += cvor[45]*y[45]*imw[45]; /*SXC12H25 */
    result += cvor[46]*y[46]*imw[46]; /*S3XC12H25 */
